/****** Object:  StoredProcedure [dbo].[GetActivoFiltro]    Script Date: 4/12/2022 10:57:52 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE procedure [dbo].[GetActivoFiltro]
@TextoFiltro varchar(30)
as

select * from activo where COD_ACTIVO in 
(
	select a.COD_ACTIVO from ACTIVO a
	inner join ACTIVO_TIPO t on a.COD_TIPO_ACTIVO = t.cod_tipo_activo
	inner join ACTIVO_MARCA m on m.COD_MARCA=a.COD_MARCA
	inner join ACTIVO_ESTADO e on e.COD_ESTADO=a.COD_ESTADO
	inner join empresa o on o.cod_empresa=a.COD_ORGANIZACION
	where 
	a.DESCRIPCION like '%'+@textoFiltro+'%' or
	a.NRO_INVENTARIO like '%'+@textoFiltro+'%' or
	a.NRO_SERIE like '%'+@textoFiltro+'%' or
	e.DESCRIPCION like '%'+@textoFiltro+'%' or
	t.DESCRIPCION like '%'+@textoFiltro+'%' or
	m.DESCRIPCION like '%'+@textoFiltro+'%' or
	o.RAZON_SOCIAL like '%'+@textoFiltro+'%' 
)
--exec GetActivoFiltro 'lexm'

GO
