CREATE procedure [dbo].[GetAll]
@NombreTabla varchar(30),
@Id bigint = null
as

begin

declare @clavePrimaria varchar(30) = (SELECT COLUMN_NAME
										FROM INFORMATION_SCHEMA.KEY_COLUMN_USAGE
										WHERE OBJECTPROPERTY(OBJECT_ID(CONSTRAINT_SCHEMA + '.' + QUOTENAME(CONSTRAINT_NAME)), 'IsPrimaryKey') = 1
										AND TABLE_NAME = @NombreTabla AND TABLE_SCHEMA = 'dbo')

print 'tabla ==> ' + @nombretabla + ' key ==> ' + @claveprimaria

if @Id is null
	exec('select top 50 * from '+ @NombreTabla)
else
	exec('select * from '+ @NombreTabla +' where ' + @clavePrimaria + ' = ' + @id)
	
end

