CREATE procedure [dbo].[GetDatosOrdenPagoReporte]
@ordpag bigint
as
begin

select op.CuitProveedor,
op.FechaPago,
op.FechaEmision,
op.Importe as ImporteTotal,
op.Pagado,op.Anulado,
det.*,
fac.FechaEmision FechaEmisionFactura,
fac.FechaVto FechaVtoFactura,
p.RAZON_SOCIAL,
p.DIRECCION,
p.TELEFONO,
p.EMAIL from ORDEN_PAGO_DETALLE det
inner join FACTURAREPARACION fac on fac.NroFactura = det.NroFactura
inner join ORDEN_PAGO op on op.NroOrdenPago = det.NroOrdenPago
inner join PROVEEDOR p on p.CUIT=op.CuitProveedor

where det.NroOrdenPago = @OrdPag


end

