CREATE procedure [dbo].[SP_Activo]
@operacion int				,
@id int						=null,
@fecha_alta datetime		=null,
@nro_inventario varchar(50)	=null,
@nro_serie varchar(255)		=null,
@descripcion varchar(255)	=null,
@sector int					=null,
@ubicacion int				=null,
@estado int					=null,
@tipo int					=null,
@marca int					=null,
@organizacion int			=null,
@moneda int					=null,
@valor_compra float			=null,
@valor_soporte float		=null,
@fecha_compra datetime		=null,
@meses_garantia int			=null,
@volumen int				=null,
@observaciones varchar(max)	=null,
@usuario varchar(50)	=null
as

if @operacion=1 
begin
    insert into ACTIVO
    values
    (@fecha_alta,
    @nro_inventario,
    @nro_serie,
    @descripcion,
    @sector,
    @ubicacion,
    @estado,
    @tipo,
    @marca,
    @organizacion,
    @moneda,
    @valor_compra,
    @valor_soporte,
    @fecha_compra,
    @meses_garantia,
    @volumen,
    @observaciones)
    --select * from ACTIVOH
    insert into ACTIVOH
    values
    (
    IDENT_CURRENT('ACTIVO')
    ,@fecha_alta
    ,@nro_inventario
    ,@nro_serie
    ,@descripcion  
    ,@sector
    ,@ubicacion
    ,@estado
    ,@tipo
    ,@marca
    ,@organizacion
    ,@moneda
    ,@valor_compra
    ,@valor_soporte
    ,@fecha_compra
    ,@meses_garantia
    ,@volumen
    ,@observaciones
    ,@usuario
    ,getdate()
    ,1)
end

if @operacion=2
begin
    insert into activoH
    select *,@usuario,getdate(),2 from activo where COD_ACTIVO=@id;

	delete ACTIVO where COD_ACTIVO=@id;
end

if @operacion=3
begin 

update ACTIVO
set FECHA_ALTA=@fecha_alta,
NRO_INVENTARIO=@nro_inventario,
NRO_SERIE=@nro_serie,
DESCRIPCION=@descripcion,
COD_SECTOR=@sector,
COD_UBICACION=@ubicacion,
COD_ESTADO=@estado,
COD_TIPO_ACTIVO=@tipo,
COD_MARCA=@marca,
COD_ORGANIZACION=@organizacion,
COD_MONEDA=@moneda,
VALOR_COMPRA=@valor_compra,
VALOR_SOPORTE=@valor_soporte,
FECHA_COMPRA=@fecha_compra,
PERIODO_GARANTIA=@meses_garantia,
VOLUMEN=@volumen,
OBSERVACIONES=@observaciones
where COD_ACTIVO=@id

insert into ACTIVOH
    values
    (
    @id
    ,@fecha_alta
    ,@nro_inventario
    ,@nro_serie
    ,@descripcion  
    ,@sector
    ,@ubicacion
    ,@estado
    ,@tipo
    ,@marca
    ,@organizacion
    ,@moneda
    ,@valor_compra
    ,@valor_soporte
    ,@fecha_compra
    ,@meses_garantia
    ,@volumen
    ,@observaciones
    ,@usuario
    ,getdate()
    ,3)

end 

if @operacion=4
	if @id is null
		select top 400 * from Activo 
	else
		select * from ACTIVO where COD_ACTIVO=@id


if @operacion=20
select * from Activoh


