CREATE procedure [dbo].[SP_CLIENTE]
  @operacion int,
  @id int = null,
  @apellido varchar(50) = null,
  @nombre varchar(50) = null,
  @telefono varchar(20) = null,
  @email varchar(30) = null,
  @empresa bigint = null  
  as
  begin


  if @operacion=1
  insert into [CLIENTE] values
  (@apellido,@nombre,@telefono,@email,@empresa)

  if @operacion=2
  delete [CLIENTE]
  where COD_USUARIO=@id

  if @operacion=3
  update [CLIENTE]
  set APELLIDO=@apellido,
  NOMBRE=@nombre,
  TELEFONO=@telefono,
  EMAIL=@email,
  COD_ORGANIZACION=@empresa
  where COD_USUARIO=@id
  
  if @operacion=4
    if @id is NULL
		select top 50 * from CLIENTE
