CREATE procedure [dbo].[SP_FACTURA]
@operacion int,
@id bigint = null
,@NroFactura bigint = null
,@Codigo int = null
,@Letra char(1) = null
,@CuitProveedor bigint = null 
,@FechaVto date = null
,@FechaEmision date = null
,@Importe decimal(18,2) = null
,@estado bit = null
,@dvh varchar(50) = null
,@usuario varchar(50) = null
,@FechaRestauracion datetime = null

as
begin

if @operacion=1 
begin
insert into FacturaReparacion
values
(@NroFactura 
,@Codigo
,@Letra
,@CuitProveedor  
,@FechaVto
,@FechaEmision
,@Importe
,@estado
,@dvh)

--select * from facturah
insert into Facturah
values
(
IDENT_CURRENT('FacturaReparacion')
,@NroFactura 
,@Codigo
,@Letra
,@CuitProveedor  
,@FechaVto
,@FechaEmision
,@Importe
,@estado
,@dvh
,@usuario
,getdate()
,1)
end

if @operacion=2
	delete FacturaReparacion where FacturaId=@id

if @operacion=3
	update FacturaReparacion
set NroFactura= @NroFactura 
,Codigo = @Codigo
,Letra = @Letra
,CuitProveedor = @CuitProveedor  
,FechaVto = @FechaVto
,FechaEmision = @FechaEmision
,Importe=@Importe
,Estado = @estado
where FacturaId=@id

if @operacion=4
	if @id is null
		select * from FacturaReparacion where Estado = 1
	else
		select * from FacturaReparacion where FacturaId = @id and Estado = 1
--exec GetAll 'FacturaReparacion',@id


if @operacion=10
select * from FACTURAREPARACION fac
where CuitProveedor=@CuitProveedor
and NroFactura not in (
	select NroFactura from ORDEN_PAGO_DETALLE opd
	inner join ORDEN_PAGO op on op.NroOrdenPago = opd.NroOrdenPago
	where op.anulado = 0
)

if @operacion=20
select * from facturah
order by fecha desc

if @operacion=30
begin

	insert into facturah
	select FacturaId,NroFactura,Codigo,Letra,CuitProveedor,
	FechaVto,FechaEmision,importe,0,DVH,@usuario,GETDATE(),2
	from FACTURAREPARACION
	where FacturaId in (select FacturaId from facturah where CONVERT(varchar,fecha,20) > @FechaRestauracion)
	and estado = 1

	update FACTURAREPARACION
	set Estado = 0
	where FacturaId in (select FacturaId from facturah where CONVERT(varchar,fecha,20) > @FechaRestauracion)	

	update ORDEN_PAGO
	set Anulado=1
	from ORDEN_PAGO o 
	inner join ORDEN_PAGO_DETALLE d
	on o.NroOrdenPago = d.NroOrdenPago
	where d.NroFactura in ( select NroFactura from facturah where CONVERT(varchar,fecha,20) > @FechaRestauracion)
	   
end

if @operacion=31
begin

	declare @_estado bit = (select estado from FACTURAREPARACION where FacturaId=@id)
	
	if(@_estado = 0)
		update FACTURAREPARACION set Estado = 1 where FacturaId = @id

	if(@_estado = 1) 
		update FACTURAREPARACION set Estado = 0	where FacturaId = @id
	
	insert into facturah
	select FacturaId,NroFactura,Codigo,Letra,CuitProveedor,
	FechaVto,FechaEmision,importe,Estado,DVH,@usuario,GETDATE(),2
	from FACTURAREPARACION
	where FacturaId = @id
	
end

end

