/****** Object:  StoredProcedure [dbo].[SP_FACTURA_DETALLE_VALIDACION]    Script Date: 4/12/2022 10:57:52 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE procedure [dbo].[SP_FACTURA_DETALLE_VALIDACION]
@OTReparacion varchar(20) = null
,@Cuit bigint = null
,@operacion int = null
as

if @operacion=5 --si fue previamente facturada
select d.* from FacturaDetalle d
inner join FacturaReparacion f on f.NroFactura = d.NroFactura 
where OtReparacion=@OTReparacion and CuitProveedor=@Cuit and f.Estado = 1

if @operacion=6 --si existe la ot
select pre.* from PRESUPUESTO_REPARACION pre
inner join PROVEEDOR pro on pre.COD_PROVEEDOR = pro.COD_PROVEEDOR
where pre.OT_PROVEEDOR=@OTReparacion and CUIT=@Cuit

if @operacion=7 --si presupuesto autorizado y reparacion finalizada
select pre.* from PRESUPUESTO_REPARACION pre
inner join PROVEEDOR pro on pre.COD_PROVEEDOR = pro.COD_PROVEEDOR
inner join REPARACION rep on rep.COD_REPARACION = pre.COD_REPARACION
where pre.OT_PROVEEDOR=@OTReparacion and CUIT=@Cuit 
and pre.AUTORIZADO=1 and not rep.FECHA_FINALIZACION is null 
and convert(date,rep.FECHA_FINALIZACION,103) <= convert(date,getdate(),103)

--[SP_FACTURA_DETALLE_VALIDACION] 'ab1234',30708495502,7

