CREATE procedure [dbo].[SP_PRESUPUESTO]
	@operacion int,
	@id bigint = null,
	@codigoReparacion bigint = null,
	@codigoProveedor bigint = null,
	@fecha datetime = null,
	@fechaValidez datetime = null,
	@tiempoReparacion int = null,
	@cotizacion decimal(18,2) = null,
	@autorizado bit = null,
	@moneda int = null,
	@descripcion varchar(max) = null,
	@ot varchar(20) = null,
	@cuitProveedor bigint = null
  as
  begin

  if @operacion=1 
  INSERT INTO [dbo].[PRESUPUESTO_REPARACION]
           ([COD_PROVEEDOR]
           ,[FECHA_PRESUPUESTO]
           ,[FECHA_VALIDEZ]
           ,[TIEMPO_ESTIMADO_REPARACION]
           ,[COTIZACION]
           ,[ESTADO]
           ,[COD_REPARACION]
           ,[DESCRIPCION]
		   ,[AUTORIZADO]
		   ,[MONEDA]
		   ,[OT_PROVEEDOR])
     VALUES
           (@codigoProveedor,
            @fecha,
            @fechaValidez,
            @tiempoReparacion,
            @cotizacion,
            1,
			@codigoReparacion,
            @descripcion,
		    @autorizado,
			@moneda,
			@ot)

  if @operacion = 2
	delete PRESUPUESTO_REPARACION where COD_PRESUPUESTO=@id

  if @operacion = 3
  UPDATE [dbo].[PRESUPUESTO_REPARACION]
   SET [COD_PROVEEDOR] = @codigoProveedor
      ,[FECHA_PRESUPUESTO] = @fecha
      ,[FECHA_VALIDEZ] = @fechaValidez
      ,[TIEMPO_ESTIMADO_REPARACION] = @tiempoReparacion
      ,[COTIZACION] = @cotizacion
      ,[ESTADO] = 1
      ,[DESCRIPCION] = @descripcion
      ,[AUTORIZADO] = @autorizado
	  ,[MONEDA]=@moneda
	  ,[OT_PROVEEDOR] =@ot
 WHERE cod_reparacion = @codigoReparacion and cod_presupuesto=@id
	
  if @operacion=4
	exec GetAll '[PRESUPUESTO_REPARACION]'

if @operacion=5
	select * from PRESUPUESTO_REPARACION
	where COD_REPARACION = @codigoReparacion

if @operacion=6
	select * from PRESUPUESTO_REPARACION pre
	inner join PROVEEDOR pro on pro.COD_PROVEEDOR=pre.COD_PROVEEDOR
	where OT_PROVEEDOR=@ot
	and CUIT=@cuitProveedor
	

end

GO
/****** Object:  StoredProcedure [dbo].[SP_PROVEEDOR]    Script Date: 4/12/2022 10:57:52 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE procedure [dbo].[SP_PROVEEDOR]
@operacion int,
@id bigint					= null,
@RAZONSOCIAL nvarchar(255)	= null,
@CUIT decimal				= null,
@DIRECCION varchar(50)		= null,
@TELEFONO varchar(50)		= null,
@EMAIL varchar(50)			= null,
@Obs varchar(max)			= null,
@estado varchar(max)			= null
as

	if @operacion=1
		INSERT INTO [dbo].PROVEEDOR
		VALUES(
		@RAZONSOCIAL,
		@CUIT,
		@DIRECCION,
		@TELEFONO,
		@Obs,
		@estado,
		@EMAIL)

	if @operacion=2
		delete PROVEEDOR where COD_PROVEEDOR=@id

	if @operacion=3
	update [dbo].PROVEEDOR 
		SET RAZON_SOCIAL=@RAZONSOCIAL,
		CUIT=@CUIT,
		DIRECCION=@DIRECCION,
		TELEFONO=@TELEFONO,
		OBSERVACIONES = @Obs,
		ESTADO = @estado,
		EMAIL=@EMAIL
		where COD_PROVEEDOR=@id

  if @operacion=4
	if @id is null
		select * from PROVEEDOR 
	else
		select * from PROVEEDOR where COD_PROVEEDOR=@id

if @operacion=6
	select * from PROVEEDOR where CUIT=@cuit

if @operacion=10
	select * from PROVEEDOR
	where COD_PROVEEDOR in (
		select COD_PROVEEDOR from PRESUPUESTO_REPARACION
		where AUTORIZADO=1
		and OT_PROVEEDOR not in 
		(select OtReparacion from FACTURADETALLE fd
		inner join FACTURAREPARACION f on f.NroFactura=fd.NroFactura
		where f.Estado = 1 )
	)
