GO
CREATE procedure [dbo].[SP_REPARACION]
  @operacion int,
  @id bigint = null,
  @activo bigint = null,
  @descripcion varchar(max) = null,
  @estado bit = null,
  @fecha_solicitud datetime = null,
  @fecha_finalizacion datetime = null,
  @usuario bigint = null,
  @ticket bigint = null
  as

  if @operacion=1
	insert into REPARACION values( @activo,@descripcion,@estado,@fecha_solicitud,@fecha_finalizacion,@ticket,@usuario )

  if @operacion=2
	update REPARACION set ESTADO = 0
	where COD_REPARACION=@id

	if @operacion=3
	update REPARACION 
	set COD_ACTIVO = @activo,
	DESCRIPCION = @descripcion,
	ESTADO = @estado,
	FECHA_SOLICITUD = @fecha_solicitud,
	FECHA_FINALIZACION = @fecha_finalizacion,
	TICKET_SOPORTE = @ticket,
	COD_USUARIO = @usuario
	where COD_REPARACION=@id

 if @operacion=4
	if @id is null
		select * from REPARACION where ESTADO = 1
	else
		select * from REPARACION where ESTADO = 1 and COD_REPARACION = @id
		
if @operacion=10
INSERT INTO [dbo].[REPARACION_REEMPLAZO_TEMPORAL]
VALUES (@activo,
		@id,
        @fecha_solicitud,
        @fecha_finalizacion,
        @descripcion,
		@estado)

if @operacion=11
delete [dbo].[REPARACION_REEMPLAZO_TEMPORAL]
where COD_ACTIVO=@activo and COD_REPARACION=@id

if @operacion=12
update [dbo].[REPARACION_REEMPLAZO_TEMPORAL]
set FECHA_INICIO = @fecha_solicitud,
    FECHA_FIN	 = @fecha_finalizacion,
    DESCRIPCION	 = @descripcion,
	DEFINITIVO	 = @estado
where COD_REPARACION = @id
and COD_ACTIVO = @activo

if @operacion=13
select * from REPARACION_REEMPLAZO_TEMPORAL
where COD_REPARACION=@id



GO
