CREATE procedure [dbo].[SP_USUARIO_MODIFICAR]
@nombre nvarchar(50),
@email nvarchar(256), 
@intentosFallidos int, 
@bloqueado bit, 
@idioma nvarchar(50), 
@estado bit,
@usuarioModificador nvarchar(50),
@dvh nvarchar(50)
as
begin

UPDATE [dbo].[USUARIO]
SET 
EMAIL=@email, 
INTENTOS_FALLIDOS=@intentosFallidos, 
BLOQUEADO=@bloqueado, 
COD_IDIOMA=@idioma, 
ESTADO=@estado,
DVH = @dvh
WHERE COD_USUARIO=@nombre;

INSERT INTO [dbo].[USUARIOH]
select *, @usuarioModificador as USUARIO_MODIFICADOR, getdate() as FECHA, iif(ESTADO=1,3,2) as TIPO_MODIFICACION from USUARIO where COD_USUARIO=@nombre;

end
GO
